const optionsState = {
  transactions: false,
  projects: false,
};

const ToggleOptions = (state = optionsState, action) => {
  switch (action.type) {
    case "OPTIONS":
      state = {
        transactions: true,
        projects: false,
      };
      return state;
    default:
      return "Hello World";
  }
};

export default ToggleOptions;
